import React from 'react';

const VideoDetail = ({video}) => {
    if(!video) {
        return <div>Loading...</div>
    }

    return (
        <div>
            <div>
                <h4></h4>

            </div>
            {video.snippet.title}
        </div>
    )
}

export default VideoDetail;
